import React from 'react';
import { ThemeProvider } from 'styled-components';
import {AppStyle, theme} from './styled/theme';
import Navbar from './components/navbar';

function App() {
	return (
		<ThemeProvider theme={theme}>
			<AppStyle>
        <Navbar></Navbar>
        Hello World
			</AppStyle>
		</ThemeProvider>
	);
}

export default App;
